import React from "react";
import classes from "./FoodItem.module.css";

const FoodItem = (props) => {
  return (
    <React.Fragment>
        <div className={classes["item"]}>
            <div className={classes["description"]}>
                <h3>Food</h3>
                <span>Hi</span>
            </div>
            <div>{props.quantity}</div>
        </div>
    </React.Fragment>
  );
};

export default FoodItem;
